function xlsgui(str_title,str_id,f_callback,str_plotx,str_ploty)
%xlsgui(str_title,str_id,f_callback,str_plotx,str_ploty)
%
%Create a simple GUI for a computation based on data in an XLS.
%The GUI will contain a plot window if str_plotx and str_ploty
%are specified.
%
% str_title:  title of the GUI window
% str_id:     ID string of the data sheets, only sheets are
%             processed that have this string in their A1 field
% f_callback: function that does the computation. Call syntax
%             is data=f_callback(data), where data is a struct
%             containg the columns of the XLS in fields defined
%             in the XLS (row 2). Results must be written back
%             by f_callback to the corresponding fields. All fields
%             with changed data will be written back to the XLS.
% str_plotx:  optional name of the field containing the x data
%             to plot (may be empty, then x is the sample number)
% str_ploty:  optional field containing the y data to plot
% 
%
%(c) 2014 ABB Switzerland Ltd., all rights reserved
%(p) ABB.CH-RD.C1 / JP


if nargin<4, str_plotx=''; end
if nargin<5, str_ploty=''; end
if isempty(str_ploty), ax_y = 0; else ax_y=430; end
f = figure(957484);

deltay=0;
clf;
set(f,'NumberTitle','off','Name',str_title,'MenuBar','none','Visible','off',...
  'Position',[360,500,825,120+ax_y],'resize','off','toolbar','figure');
y0 = 70 + ax_y + deltay;
uicontrol('Style','text','String','XLS','Position',[10,y0+10,60,20],'HorizontalAlignment','left','fontsize',12);
hxls = uicontrol('Style','edit','Position',[80,y0+5,430,30],...
  'enable','inactive','HorizontalAlignment','left','fontsize',12);
hpb(1) = uicontrol('Style','pushbutton','String','select','Position',[530,y0+4,70,32],'Callback',{@pbxlscb},'fontsize',12,'fontweight','bold');
hpb(2) = uicontrol('Style','pushbutton','String','open','Position',[610,y0+4,70,32],'Callback',{@pbopenxlscb},'fontsize',12,'fontweight','bold');
logo=abblogo;
h1=axes('Units','Pixels','position',[710 y0+4 40*size(logo,2)/size(logo,1) 40]);
image(logo);
axis(h1,'off');
set(h1,'dataaspectratio',[1 1 1]);
uicontrol('Style','text','String','developed@CH-RD.C1','Position',[710 y0-9 40*size(logo,2)/size(logo,1) 10],'HorizontalAlignment','center','fontsize',7);

y0 = y0-50;
uicontrol('Style','text','String','sheet','Position',[10,y0+10,60,20],'HorizontalAlignment','left','fontsize',12);
hsheet = uicontrol('Style','edit','Position',[80,y0+5,160,30],...
  'enable','on','HorizontalAlignment','left','fontsize',12);
uicontrol('Style','text','String','(leave empty for all valid sheets)','Position',[260,y0+10,240,20],'HorizontalAlignment','left','fontsize',12);
hpb(3) = uicontrol('Style','pushbutton','String','compute','Position',[530,y0+4,100,32],'Callback',{@pbcompute},'fontsize',12,'fontweight','bold','ForegroundColor',[0 75 122]/255);
hstatus = uicontrol('Style','text','Position',[650,y0+10,160,20],'HorizontalAlignment','left','fontsize',12);

if ax_y>0
  y0 = y0-ax_y+40;
  ha = axes('Units','Pixels','position',[70 y0 730 ax_y-70]);
  set(ha,'fontsize',12);
  grid on;
end

movegui(f,'center');
set(f,'Visible','on');

xlsfile = {};

  function pbxlscb(source,eventdata) %#ok<*INUSD>
    [filename,pathname] = uigetfile({'*.xls;*.xlsx' 'MS Excel sheets (*.xls, *.xlsx)'},'Select the SWopt input file');
    if ischar(filename) 
      xlsfile = {pathname filename};
      set(hxls,'String',[xlsfile{:}]);
      
    end
  end

  function pbopenxlscb(source,eventdata)
    if ~isempty(xlsfile)
      try
        h = actxGetRunningServer('Excel.Application');
      catch %#ok<CTCH>
        h = actxserver('Excel.Application');
      end
      try
        set(h, 'Visible', 1);
      catch %#ok<CTCH>
      end
      try
        h.Workbooks.Open([xlsfile{:}]);
      catch %#ok<CTCH>
      end
    end
  end

  function pbcompute(source,eventdata)
    for i=1:length(hpb), set(hpb(i),'enable','off'); end
    set(hstatus,'string','preparing ...'); drawnow;
    if ~exist([xlsfile{:}],'file')
      errordlg('Selected XLS does not exist');
      return;
    end
    try
      h = actxGetRunningServer('Excel.Application');
      wb = h.WorkBooks.Item(xlsfile{2});
      dosave = questdlg({'Need to close Excel workbook.' 'Save before closing?'},...
        [str_title ': closing Excel workbook'],'Yes','No','Cancel','Yes');
      if strcmp(dosave,'Cancel'), return; end
      if strcmp(dosave,'Yes'), wb.Save;
      else wb.Saved = 1; end
      wb.Close;
    catch %#ok<CTCH>
    end
    sheets = get(hsheet,'string');
    if ~isempty(sheets), sheets={sheets}; else 
      [~,sheets] = xlsfinfo([xlsfile{:}]);
    end
    for i=1:length(sheets)
      set(hstatus,'string',[sheets{i} ' ...']);  drawnow;
      [X,hdr] = xlsread([xlsfile{:}],sheets{i});
      if ~strcmp(hdr{1,1},str_id), continue; end
      data = [];
      for j=1:size(hdr,2)
        data.(hdr{2,j}) = X(1:find(~isnan(X(:,j)), 1, 'last' ),j);
      end
      try
        data = f_callback(data);
      catch exc
        msg = regexprep(strrep(exc.message,'</a>',''),'<a href[^>]+>','');
        msg(msg<' ')=' ';
        errordlg(['Exception in callback function: ' msg ' in ' ...
          exc.stack(1).name ' line ' num2str(exc.stack(1).line)]);
        return;
      end
      upd = zeros(1,size(X,2));
      upd2 = upd;
      N = max(size(X,1), max(cellfun(@(x)length(data.(x)),hdr(2,:))));
      X1 = nan(N,size(X,2));
      for j=1:size(hdr,2)
        x = data.(hdr{2,j});
        X1(1:length(x),j) = x;
        j0 = find(~isnan(X(:,j)));
        j1 = find(~isnan(x));
        if length(j0)~=length(j1) || any(j0~=j1) || any(X(j0,j)~=x(j1))
          ji = intersect(j0,j1);
          jupd = union(ji(X(ji,j)~=x(ji,1)),setxor(j0,j1));
          upd(j) = min(jupd);
          upd2(j) = max(jupd);
        end
      end
      while any(upd)
        col = find(upd,1);
        n = find([~upd(col+1:end) 1],1);
        row = min(upd(col:col+n-1));
        xlswrite([xlsfile{:}],X1(row:max(upd2(col:col+n-1)),col:col+n-1),...
          sheets{i},[xlscol(col) num2str(3+row)]);
        upd(col:col+n-1) = 0;
      end
    end
    set(hstatus,'string','completed!');
    for i=1:length(hpb), set(hpb(i),'enable','on'); end
    try
      if ~isempty(str_ploty)
        y = data.(str_ploty);
        if isempty(str_plotx), 
          x=1:length(y);
          xlbl = 'sample';
        else
          x = data.(str_plotx);
          xlbl = hdr{3,find(strcmp(str_plotx,hdr(2,:)),1)};
        end
        if length(y)>50, plot(x,y,'b-');
        elseif length(y)>20, plot(x,y,'.b-');
        else plot(x,y,'ob-');
        end
        xlabel(xlbl);
        ylabel(hdr{3,find(strcmp(str_ploty,hdr(2,:)),1)});
        title(sheets{end});
        grid on;
      end
    catch
      errordlg('error while plotting, probably due to inconsistent x and y data');
    end
  end
end

